import { VFC } from 'react';
import styled from "styled-components";
import character from 'const/character';
import { BaseColumnProps } from 'component/column/input/columnDef'

export const MFOutoPut: VFC<BaseColumnProps> = ({label, id, value}) =>{
    return(
        <StyledItem>
            <StyledLabel id={id}>{label}</StyledLabel>
                <StyledValue> {value}</StyledValue>
        </StyledItem>
    )
}

const StyledItem =styled.div`
margin-left: auto;
margin-right: auto;
font-family: ${character.FONT};
font-size:  ${character.SIZE.LARGE}px;
`;

const StyledLabel =styled.label`
display: inline-block;
vertical-align: top;
display: flex;
align-items: center;
height: 40px
border: solid 5px #5250e0;
`;

const StyledValue =styled.div`
margin-top: 30px;
width: 300px;
height: 100px;
border-radius: 5px;
border: 0.2px solid #9c9c9c;
`;
